import React from 'react';
import Header from './Header';
import Login from './Login';
import {Container,Row,Col } from 'react-bootstrap';
class Main extends React.Component {
    constructor()
    {
        super();

    }
    render() { 
        return ( 
            <Container fluid={true}>
  <Row>
  <Col xl={1} style={{backgroundColor: 'orange',border:"1px solid red"}}><h6 style={{width:"100%"}}>logo</h6></Col>
   <Col xs xl={10} lg md sm style={{border:"1px solid blue",backgroundColor:"aqua"}}><h2 style={{textAlign:"center"}}>PVG's College of Science</h2></Col>
  </Row>
  <Row>
    <Col style={{backgroundColor: '#f1f1f1',height:'570px'}}>Features</Col>
    <Col style={{backgroundColor: 'pink',height:'570px'}}><Login/></Col>
  </Row>
  <Row>
      <Col style={{backgroundColor: 'orange',height:'37px'}}>Footer</Col>
  </Row>
</Container>
         );
    }
}
 
export default Main;
